import React from 'react'
class Write extends React.Component{
    constructor(props){
        super(props)
        this.state = {
            blog_category : ""
        }
    }

    render(){
        return (
            <div className="mt-5">
                <div className="row justify-content-center m-5  card">
                    <div className="input-group mb-3 m-5 w-25">
                        <div className="input-group-prepend">
                            <label className="input-group-text" for="inputGroupSelect01">Blog Category</label>
                        </div>
                        <select className="custom-select" id="inputGroupSelect01">
                            <option value="1">Programming</option>
                            <option value="2">Environment</option>
                            <option value="3">Science and Technology</option>
                            <option value="4">Economics</option>
                        </select>
                    </div>
                    <h3>Write Your Blog Below</h3>
                    <div className="card mx-5 mt-3"></div>
                </div>
            </div>
        )
    }

}

export default Write
